START TRANSACTION;

DELETE FROM TransactionDetail;
DELETE FROM TransactionMaster;

ALTER TABLE TransactionMaster AUTO_INCREMENT = 1;
ALTER TABLE TransactionDetail AUTO_INCREMENT = 1;

DROP TEMPORARY TABLE IF EXISTS denormalized;
CREATE TEMPORARY TABLE denormalized (
      Id                  int             NOT NULL AUTO_INCREMENT PRIMARY KEY
    , TransactionId       int             NULL
    , TransactionDate     datetime        NOT NULL
    , PostedDate          datetime        NULL
    , AccountNumber       varchar(50)     NOT NULL
    , Type                varchar(50)     NOT NULL
    , Description         varchar(100)    NOT NULL
    , DescriptionManual   varchar(100)    NULL
    , DescriptionDisplay  varchar(100)    NULL
    , BudgetCycle         date            NOT NULL
    , IsAutoCategorized   boolean         NOT NULL
    , IsUpdatedByUser     boolean         NOT NULL
    , Amount              decimal(15,2)   NOT NULL
    , Category            varchar(50)     NULL
    , Notes               varchar(100)    NULL
    , Tags                varchar(50)     NULL
    , DateCreated         datetime        NOT NULL  DEFAULT CURRENT_TIMESTAMP
    , CreatedBy           int             NULL  DEFAULT NULL
    , DateModified        datetime        NOT NULL  DEFAULT CURRENT_TIMESTAMP
    , ModifiedBy          int             NULL  DEFAULT NULL
    , UserId              int             NULL  DEFAULT NULL
);


SELECT * FROM denormalized ORDER BY 1 DESC;

	  TransactionDate
	, PostedDate
	, AccountId
	, TypeId
	, Description
	, DescriptionManual
	, DescriptionDisplay
	, BudgetCycleId
	, IsAutoCategorized
	, IsUpdatedByUser
    , date_created
    , date_modified
)
SELECT 
	  denormalized.TransactionDate
	, denormalized.PostedDate
	, Account.AccountId
	, Type.TypeId
	, denormalized.Description
	, denormalized.DescriptionManual
	, denormalized.DescriptionDisplay
	, BudgetCycle.BudgetCycleId
	, denormalized.IsAutoCategorized
	, denormalized.IsUpdatedByUser
	, denormalized.DateCreated
	, denormalized.DateModified
FROM denormalized
LEFT OUTER JOIN Type
	ON Type.Name = denormalized.Type
	AND Type.ResourceType = 'T'
LEFT OUTER JOIN BudgetCycle
	ON BudgetCycle.BudgetCycle = denormalized.BudgetCycle
LEFT OUTER JOIN Account
	ON Account.AccountNumber = denormalized.AccountNumber
