#WHERE TransactionMaster.TransactionId IS NULL; 
ORDER BY denormalized.Id DESC;

	  TransactionId
	, Amount
	, BudgetId
	, Notes
)
SELECT 
    ROW_NUMBER() OVER (ORDER BY denormalized.Id DESC) AS row_num
	, denormalized.Amount
	, Budget.BudgetId
	, denormalized.Notes
FROM denormalized
LEFT OUTER JOIN BudgetCycle
	ON BudgetCycle.BudgetCycle = denormalized.BudgetCycle
LEFT OUTER JOIN Budget
	ON Budget.Name = denormalized.Category
	AND Budget.BudgetCycleId = BudgetCycle.BudgetCycleId
